import * as React from 'react';
import {ScrollView,View,StyleSheet} from 'react-native';
import KeyboardSpacer from 'react-native-keyboard-spacer';
import GuideComp from '../components/GuideComp';
import style from '../style.js';


export default function Guide ({navigation}) { 

  const CalcHandler=()=>{
    navigation.navigate('Calculate');
  }
  const NoteHandler=()=>{
    navigation.navigate('Notes');
  }   
  return (  
    <ScrollView >

      <View style={styles.container}>
     
      </View>

      <View style={style.card}>
        <GuideComp title={'MY Notes'} sth={'Write your notes and checklists here to track your progress'} pic={'../images/d.jpg'} onclick={NoteHandler}/>
        <GuideComp title={'Calculate'}  sth={'To help you track your finanses and your profit'} pic={'../images/d.jpg'} onclick={CalcHandler} />
      </View>
    
    <KeyboardSpacer/>

</ScrollView>
      );
}  

const styles = StyleSheet.create({
  container:{
    margin:5,
    marginTop:25,
    justifyContent:'center',
  },
  })
